            <div key={index}>
                <h1>{hotel.name}</h1>
                <h4>{hotel.reviews?.count}</h4>
                <h5>{hotel.reviews?.rating}</h5>
                <h5>{hotel.vendor1}</h5>
            </div>
        ))
